import axios from "axios";

const API_BASE = 'https://parallelum.com.br/fipe/api/v1';

const API = {
    getMarcas: async () => {
        try {
            const response = await axios.get(`${API_BASE}/carros/marcas`);
            return response.data;
        } catch (error) {
            console.log('[ERROR]');
            console.error("Erro ao buscar dados:", error);
            return null;
        }
    },
};
